import BuscarCepComponent from "./BuscarCepComponent";

function App() {

  function PesquisarCep(cep) {
    console.log(`Cep = ${cep}`)
  }

  return (
    <section className="conteudo">
      <BuscarCepComponent PesquisarCep={this.PesquisarCep.bind(this)}/>
    </section>
  );
}

export default App;
